import React from 'react'
import { Link } from "react-router-dom";

const PageTitle = ({title}) => {
  return (
    <div class="main_header">
        <Link goTo="/"><i class="fas fa-arrow-left"></i></Link>
        <h1>{title}</h1>
      </div>
  )
}

export default PageTitle
